local Manager = s_WordDictionaryDatabase; Manager.allwords["interregnum"]={"interregnum","[,ɪntə'regnəm]","[,ɪntɚ'rɛɡnəm]","n.无王时期",'n.无王时期','No one in the interregnum seemed to feel final responsibility, and so matters drifted along.','在新旧总统交替期间，似乎谁也不愿意承担最后的责任，于是事情就这样随波逐流下去了。','There is no interregnum between the death of one sovereign and the accession of the next','君主死亡与下一君主继位之间不得有任何空位期'}
